import { Component } from 'react'; 
import logo from './logo.svg';
import './App.css';

class App extends Component {

  constructor(){
    super();
    this.state = {
      name: 'John',
      country: 'Germany'
    }
  }
  render(){
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          I am {this.state.name} from {this.state.country}.
        </p>
        <button onClick={()=>{
          this.setState({
            name: 'Paul',
            country: 'Canada'
          })
        }}>~click Me~</button>
        {console.log('latest stat',this.state)}
      </header>
    </div>
  );
  }

}

export default App;
